-- ----------------------------
-- Table structure for courses
-- ----------------------------
DROP TABLE IF EXISTS `courses`;
CREATE TABLE `courses` (
  `course_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT 'コース名',
  `amount` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '金額',
  `first_amount` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '初回決済金額（決済金額が初回のみ異なる場合に使用する）)',
  `acquisition_date` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '日数',
  `grant_week_day` tinyint(3) unsigned DEFAULT NULL COMMENT '日数を付与する曜日、曜日時間両方がnullなら決済時に日数付与',
  `grant_time` time DEFAULT NULL COMMENT '日数を付与する時間、曜日時間両方がnullなら決済時に日数付与',
  `course_status` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT 'コースステータス',
  `bank_thanks_file_name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '銀行申込のサンクスファイル名',
  `credit_thanks_file_name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT 'クレジット申込のサンクスファイル名',
  `confirm_mail_bank_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(銀行振込)',
  `confirm_mail_bank_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(銀行振込)',
  `confirm_mail_credit_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(クレジット)',
  `confirm_mail_credit_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(クレジット)',
  `complete_mail_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(決済完了メール(銀行・クレジット共通))',
  `complete_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(決済完了メール(銀行・クレジット共通))',
  `send_mail_address_id` int(10) unsigned NOT NULL COMMENT 'アドミン用メールの送信先',
  `admin_mail_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'アドミン用メール件名',
  `admin_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'アドミン用メール本文',
  `expiring_mail_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(期限切れ間近の通知)',
  `expiring_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(期限切れ間近の通知)',
  `is_credit_expiring` tinyint(3) unsigned NOT NULL DEFAULT 0 COMMENT '期限切れ間近の通知にクレジット継続中会員にも通知するか。1で通知',
  `introduction_mail_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(紹介コードの決済完了)',
  `introduction_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(紹介コードの決済完了)',
  `credit_status_change_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(クレジット継続変更)',
  `credit_status_change_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(クレジット継続変更)',
  `register_customer_mail_id` int(10) unsigned DEFAULT NULL COMMENT '会員登録時のカスタマーメールID',
  `register_mail_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(会員登録時)',
  `register_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(会員登録時)',
  `personal` varchar(255) COLLATE utf8mb4_bin DEFAULT 'あなた' COMMENT '人称',
  `suffix_honorific` varchar(255) COLLATE utf8mb4_bin DEFAULT 'さん' COMMENT '末尾の敬称',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`course_id`),
  KEY `courses_send_mail_address_id_index` (`send_mail_address_id`),
  KEY `courses_register_customer_mail_id_foreign` (`register_customer_mail_id`),
  CONSTRAINT `courses_register_customer_mail_id_foreign` FOREIGN KEY (`register_customer_mail_id`) REFERENCES `customer_mails` (`customer_mail_id`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

