  `complete_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール本文(決済完了メール(銀行・クレジット共通))',
  `send_mail_address_id` int(10) unsigned NOT NULL COMMENT 'アドミン用メールの送信先',
