  `admin_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'アドミン用メール本文',
  `register_customer_mail_id` int(10) unsigned DEFAULT NULL COMMENT '会員登録時のカスタマーメールID',
  `register_mail_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(会員登録時)',
  `register_mail_message` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'メール件名(会員登録時)',
  `personal` varchar(255) COLLATE utf8mb4_bin DEFAULT 'あなた' COMMENT '人称',
  `suffix_honorific` varchar(255) COLLATE utf8mb4_bin DEFAULT 'さん' COMMENT '末尾の敬称',
  `open_datetime` datetime DEFAULT NULL COMMENT '申込受付開始日',
  `open_teikyo_datetime` datetime DEFAULT NULL COMMENT '提供開始日時',
  `close_teikyo_type` enum('日時指定','時期指定','無制限','提供日数') COLLATE utf8mb4_bin NOT NULL DEFAULT '無制限' COMMENT '提供終了日時タイプ',
  `close_teikyo_datetime` datetime DEFAULT NULL COMMENT '提供終了日時(日時指定)',
  `close_teikyo_season_days` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '提供終了日時(時期指定): 日',
  `close_teikyo_season_time` time DEFAULT NULL COMMENT '提供終了日時(時期指定): 時',
  `group_life_time` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '提供終了日時(企画グループ商材の付与日数)',
  `course_life_time` int(10) unsigned NOT NULL DEFAULT 0 COMMENT 'コラボ放題の付与日数',
  `grant_week_day` tinyint(3) unsigned DEFAULT NULL COMMENT '日数を付与する曜日、曜日時間両方がnullなら決済時に日数付与',
  `grant_time` time DEFAULT NULL COMMENT '日数を付与する時間、曜日時間両方がnullなら決済時に日数付与',
  `project_group_id` int(10) unsigned DEFAULT NULL COMMENT '企画グループID',
  `project_priority` tinyint(4) NOT NULL DEFAULT 0,
  `is_auto_payment` tinyint(3) unsigned NOT NULL DEFAULT 0 COMMENT '1:クレジット自動決済',
  `is_add_list_manager` tinyint(3) unsigned NOT NULL DEFAULT 1 COMMENT '1:LMへ追加 0:追加しない',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
