  KEY `projects_project_group_id_foreign` (`project_group_id`),
  KEY `projects_send_mail_address_id_index` (`send_mail_address_id`),
  KEY `projects_register_customer_mail_id_foreign` (`register_customer_mail_id`),
  CONSTRAINT `projects_project_group_id_foreign` FOREIGN KEY (`project_group_id`) REFERENCES `project_groups` (`project_group_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `projects_register_customer_mail_id_foreign` FOREIGN KEY (`register_customer_mail_id`) REFERENCES `customer_mails` (`customer_mail_id`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

