COMMIT;

-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `password` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'パスワード',
  `remember_token` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '自動ログイントークン',
  `status` enum('仮登録','退会','本登録','テスト') COLLATE utf8mb4_bin NOT NULL DEFAULT '仮登録' COMMENT '会員ステータス',
  `user_token` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '会員登録トークン',
  `course_status` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'コースステータス',
  `credit_continued_status` enum('継続なし','継続中') COLLATE utf8mb4_bin NOT NULL DEFAULT '継続なし' COMMENT 'クレジット継続決済',
  `life_time` int(10) unsigned NOT NULL DEFAULT 0 COMMENT 'コース提供日数',
  `estimate_life` int(10) unsigned NOT NULL DEFAULT 0 COMMENT 'コース提供日数（累計）',
  `disable_datetime` datetime DEFAULT NULL COMMENT '退会日',
  `mail_status` enum('通常','メール配信停止','PRメール配信停止') COLLATE utf8mb4_bin NOT NULL DEFAULT '通常' COMMENT 'support@のメールステータス',
  `disable_mail_datetime` datetime DEFAULT NULL COMMENT 'メール配信停止日',
  `disable_pr_mail_datetime` datetime DEFAULT NULL COMMENT 'PRメールのみの配信停止日時',
  `aoi_mail_status` enum('通常','メール配信停止') COLLATE utf8mb4_bin NOT NULL DEFAULT '通常' COMMENT 'officem@のメールステータス',
  `cancel_aoi` datetime DEFAULT NULL COMMENT 'officem@の配信停止日',
  `is_black` tinyint(3) unsigned NOT NULL DEFAULT 0 COMMENT 'ブラックフラグ',
  `last_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '姓',
  `first_name` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '名',
  `nickname` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'ニックネーム',
  `tel` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '電話番号',
  `sex` enum('男性','女性') COLLATE utf8mb4_bin NOT NULL DEFAULT '男性' COMMENT '性別',
  `birthday` date DEFAULT NULL COMMENT '誕生日',
  `zip_code` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '郵便番号',
  `pref` enum('北海道','青森県','岩手県','宮城県','秋田県','山形県','福島県','茨城県','栃木県','群馬県','埼玉県','千葉県','東京都','神奈川県','新潟県','富山県','石川県','福井県','山梨県','長野県','岐阜県','静岡県','愛知県','三重県','滋賀県','京都府','大阪府','兵庫県','奈良県','和歌山県','鳥取県','島根県','岡山県','広島県','山口県','徳島県','香川県','愛媛県','高知県','福岡県','佐賀県','長崎県','熊本県','大分県','宮崎県','鹿児島県','沖縄県') COLLATE utf8mb4_bin NOT NULL DEFAULT '北海道' COMMENT '都道府県',
  `city` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '市区町村',
  `street` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '番地',
  `building` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '建物名・部屋番号',
  `remarks` text COLLATE utf8mb4_bin DEFAULT NULL COMMENT '備考',
  `payment_status` enum('クレジット','銀行振込') COLLATE utf8mb4_bin NOT NULL DEFAULT '銀行振込' COMMENT '支払い方法',
  `payment_carrier` enum('PC','MB') COLLATE utf8mb4_bin NOT NULL DEFAULT 'PC' COMMENT '支払い端末',
  `payment_email` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '支払い時のメールアドレス',
  `payment_tel` varchar(16) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '支払い時の電話番号',
  `registration_datetime` datetime DEFAULT NULL COMMENT '登録日',
  `registration_fingerprint` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'ブラウザフィンガープリント ',
  `registration_useragent` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'UA',
  `registration_ipaddress` varchar(255) COLLATE utf8mb4_bin NOT NULL DEFAULT '0.0.0.0' COMMENT 'IPアドレス',
  `ip_update_datetime` datetime DEFAULT NULL COMMENT 'IP更新時間',
  `registration_hostname` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'ホスト名',
  `last_login` datetime DEFAULT NULL COMMENT '最終ログイン日時',
  `user_login_count` int(10) unsigned NOT NULL DEFAULT 0 COMMENT 'ログイン回数',
  `group_id` int(10) unsigned DEFAULT NULL COMMENT 'グループID',
  `group2_id` int(10) unsigned DEFAULT NULL COMMENT 'グループ2ID',
  `group3_id` int(10) unsigned DEFAULT NULL COMMENT 'グループ3ID',
  `group4_id` int(10) unsigned DEFAULT NULL COMMENT 'グループ4ID',
  `group5_id` int(10) unsigned DEFAULT NULL COMMENT 'グループ5ID',
  `group6_id` int(10) unsigned DEFAULT NULL COMMENT 'グループ6ID',
  `ad_id` int(10) unsigned DEFAULT NULL COMMENT '広告ID',
  `ad_lp` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '広告LP',
  `is_ad_state` tinyint(3) unsigned NOT NULL DEFAULT 1 COMMENT '広告費のステータス 1:対象 0:除外',
  `is_adminnoadmin` tinyint(3) unsigned NOT NULL DEFAULT 0 COMMENT 'アドミンのアドミンからの登録かどうか',
  `is_from_line_message` tinyint(1) NOT NULL DEFAULT 0 COMMENT 'LINEのトーク画面からの会員登録かどうか',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`user_id`),
  KEY `users_registration_ipaddress_index` (`registration_ipaddress`),
  KEY `users_ad_id_index` (`ad_id`),
  KEY `users_group_id_foreign` (`group_id`),
  KEY `users_group2_id_foreign` (`group2_id`),
  KEY `users_group3_id_foreign` (`group3_id`),
  KEY `users_group4_id_foreign` (`group4_id`),
  KEY `users_group5_id_foreign` (`group5_id`),
  KEY `users_group6_id_foreign` (`group6_id`),
  CONSTRAINT `users_group2_id_foreign` FOREIGN KEY (`group2_id`) REFERENCES `user_groups` (`user_group_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `users_group3_id_foreign` FOREIGN KEY (`group3_id`) REFERENCES `user_groups` (`user_group_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `users_group4_id_foreign` FOREIGN KEY (`group4_id`) REFERENCES `user_groups` (`user_group_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `users_group5_id_foreign` FOREIGN KEY (`group5_id`) REFERENCES `user_groups` (`user_group_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `users_group6_id_foreign` FOREIGN KEY (`group6_id`) REFERENCES `user_groups` (`user_group_id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `users_group_id_foreign` FOREIGN KEY (`group_id`) REFERENCES `user_groups` (`user_group_id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

